import Modal from 'react-modal';

function CustomModal( props ) {

    const customStyles = {
        content: {
            width: '300px',
            height: '150px',
            top: '50%',
            left: '50%',
            right: 'auto',
            bottom: 'auto',
            marginRight: '-50%',
            transform: 'translate(-50%, -50%)',
        },
    };

    function closeModal() {

    }


    return (
        <Modal 
            isOpen={props.isOpen}
            style={customStyles}
            onRequestClose={props.onRequestClose}
        >
            <p style={{ color: 'red', fontSize:'1.4rem'}}>Error: Could not find any player or group of players matching the input. Are you sure that you have entered the correct values?</p>
        </Modal>
    )
}

export default CustomModal;
